import React from "react";
import Footer from "./Footer";
import Navbar from "./Navbar";

function Layout(props) {
  return (
    <div>
      <Navbar />
      {props.children}
      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default Layout;
